    }
  }

  &:before {
    content: "";
    width: 20px;
    height: 20px;
    border: 1px solid $dark-25;
    box-sizing: border-box;
    border-radius: 10px;
    position: absolute;
    top: 0;
    left: 0;
  }

  &:after {
    content: "";
    width: 12px;
    height: 12px;
    position: absolute;
    top: 4px;
    left: 4px;
    background: none;
    border-radius: 50%;
  }
}

